import React from 'react';

import Card from '../UI/Card/Card';
import classes from './Home.module.css';
import SideMenu from './SideMenu';

const Home = (props) => {
  return (
    <Card className={classes.home}>
      <h1>Welcome back!</h1>
      <SideMenu />
    </Card>
  );
};

export default Home;
